import React, { Component } from 'react';
import { NavbarProvider } from './NavbarContext';

//Navbar
const Navbar = {item_1:"首頁",item_2:"活動",item_3:"商品"};

class Header extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <>
            <div>
            <NavbarProvider value={Navbar}>
                <Navbar/>
            </NavbarProvider>
            </div>
            </>
        );
    }
}

export default Header;
